import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './css/EducationPage.css';

function EducationPage({ onBackClick }) {
  const [tuition, setTuition] = useState(0);
  const [schoolData, setSchoolData] = useState(null);

  useEffect(() => {
    const fetchSchoolData = async () => {
      try {
        const response = await axios.get('/api/school-data');
        setSchoolData(response.data);
      } catch (error) {
        console.error('Error fetching school data:', error);
      }
    };

    fetchSchoolData();
  }, []);

  const calculateTuition = () => {
    if (schoolData && schoolData.privateTuition) {
      const { kindergartenTuition, elementaryTuition, highSchoolTuition } = schoolData.privateTuition;
      const kindergartenYears = 1;
      const elementaryYears = 5;
      const highSchoolYears = 4;
      const totalTuition =
        kindergartenTuition * kindergartenYears +
        elementaryTuition * elementaryYears +
        highSchoolTuition * highSchoolYears;
      setTuition(totalTuition);
    }
  };

  return (
    <div className="education-page-container">
      <h2>Education Resources</h2>
      <p className="intro-text">
        Choosing the right school for your child is an important decision. Explore the different types of schools available and their unique benefits to make an informed choice.
      </p>
      <div className="school-types">
        <div className="school-type">
          <img src="/images/public-school.jpg" alt="Public School" className="school-image" />
          <h3>Public Schools</h3>
          <p>Public schools are government-funded and provide free education to all students. They follow a standardized curriculum and offer a diverse range of programs and extracurricular activities.</p>
          <h4>Benefits:</h4>
          <ul>
            <li>Tuition-free education</li>
            <li>Diverse student population</li>
            <li>Wide range of academic and extracurricular programs</li>
            <li>Experienced and certified teachers</li>
          </ul>
          <a href="/public-schools" className="learn-more-link">Learn More</a>
        </div>
        <div className="school-type">
          <img src="/images/private-school.jpg" alt="Private School" className="school-image" />
          <h3>Private Schools</h3>
          <p>Private schools are independently funded and charge tuition fees. They offer smaller class sizes, specialized programs, and a more personalized learning experience.</p>
          <h4>Benefits:</h4>
          <ul>
            <li>Smaller class sizes for individualized attention</li>
            <li>Specialized curricula and programs</li>
            <li>State-of-the-art facilities and resources</li>
            <li>Strong emphasis on academic excellence</li>
          </ul>
          <div className="tuition-calculator">
            <h4>Tuition Calculator</h4>
            <p>Get an estimate of the total private school tuition from kindergarten to high school:</p>
            <button onClick={calculateTuition} className="calculate-button">Calculate</button>
            {schoolData && schoolData.privateTuition && (
              <div className="tuition-breakdown">
                <p>Kindergarten Tuition (1 year): ${schoolData.privateTuition.kindergartenTuition.toLocaleString()}</p>
                <p>Elementary School Tuition (5 years): ${(schoolData.privateTuition.elementaryTuition * 5).toLocaleString()}</p>
                <p>High School Tuition (4 years): ${(schoolData.privateTuition.highSchoolTuition * 4).toLocaleString()}</p>
                <p className="total-tuition">Total Tuition (K-12): ${tuition.toLocaleString()}</p>
              </div>
            )}
          </div>
          <a href="/private-schools" className="learn-more-link">Learn More</a>
        </div>
        <div className="school-type">
          <img src="/images/charter-school.jpg" alt="Charter School" className="school-image" />
          <h3>Charter Schools</h3>
          <p>Charter schools are publicly funded but independently operated. They have the flexibility to design innovative curricula and teaching methods while being held accountable for student performance.</p>
          <h4>Benefits:</h4>
          <ul>
            <li>Innovative teaching approaches</li>
            <li>Specialized focus on specific subjects or themes</li>
            <li>Increased autonomy in school operations</li>
            <li>Higher level of parental and community involvement</li>
          </ul>
          <a href="/charter-schools" className="learn-more-link">Learn More</a>
        </div>
      </div>
      <button className="back-button" onClick={onBackClick}></button>
    </div>
  );
}

export default EducationPage;
